Nicole Avery &quot;Nikki&quot; Cox (born June 2, 1978) is an American actress known mostly for her roles on the television series Unhappily Ever After and Las Vegas. Cox was born in Los Angeles, California, the daughter of Meredith and Terry Cox, who is a personal manager. Cox&amp;#039;s career as an entertainer started at the age of four, as she appeared as a dancer in several ballet productions and TV specials. She began acting at the age of ten, making appearances in several movies and guest starring on shows such as Baywatch, Webster, California Dreams, Star Trek: The Next Generation, and Blossom. She also starred in General Hospital from 1993 to 1995.
